import React from 'react';
import axios from 'axios';

var info = []


function Search() {

    function getMovieData(){

        axios.get('https://api.themoviedb.org/3/movie/top_rated?api_key=15e1bbc41548aa6ea02bac4f092efa6f&language=en-US&page=1')
        .then(response => JSON.stringify(response))
        .then(response => {
            info = response.toString().split(',')
        })
        .catch(function(error){
            alert(error)
        })  
        return info


    }
    return (

        <div>
         <br></br>
        <h1 class='page-name'>Search</h1>
        <br></br>
        <br></br>
        <span>
            <form action="">
            <label htmlFor="movieSearch">Search for a Movie: </label>
            <br></br>
            <br></br>
            <input type="text" name="movieSearch"/>
            <br></br>
            <button type="submit" id="submitButton" onClick={this.getMovieData}>Submit</button>
            </form>
            <br></br>
            <span id='1'>{getMovieData()}</span>

        </span>
        </div>
    )
    }

    export default Search
